import React from 'react';

function ActionButton({ onClick, title }) {
  return <button onClick={onClick}>{title}</button>;
}
/*
// Assuming the other file doesn't introduce new props, otherwise, add them here
function ActionButton({ text, additionalClasses = '', additionalProperties = {} }) {
  // Merge additionalProperties handling here. If the other file has different defaults or additional fields, adjust accordingly.
  return (
    <input
      id={additionalProperties.id ?? 'button'}
      type={additionalProperties.type ?? 'submit'}
      form={additionalProperties.form ?? 'uploadImage'}
      // Combine className strings from both files, adjust as necessary if the other file has different or additional styling
      className={`justify-center py-9 pr-20 pl-16 bg-sky-700 rounded-xl border border-black border-solid shadow-md max-md:pr-8 max-md:pl-7 max-md:text-4xl ${additionalClasses}`}
      value={text}
      name="submit"
    />
  );
};
*/
export default ActionButton;
